import React from 'react';
import { AppBar, Toolbar, Typography, Container, Paper, Grid, Link } from '@mui/material';
import { Person as PersonIcon, Work as WorkIcon, Code as CodeIcon, Mail as MailIcon } from '@mui/icons-material';
import './App.css';
import Experience from '../Experience/Experience';

function App() {
  return (
    <div className="App">
      <h1>Zach Garrison</h1>
      <Container className="App-container">
        <Paper className="App-paper" elevation={3}>


          <section className="About">
            <Typography variant="h4" className="App-section-title">About Me</Typography>
            <Typography>
              Welcome to my portfolio! I am a passionate web developer with expertise in front-end technologies.
              Let me tell you a bit about myself...
            </Typography>
          </section>
        <Experience />

          <section className="TechnicalSkills">
            <Typography variant="h4" className="App-section-title">Technical Skills</Typography>
            <ul>
              <li>JavaScript / ES6</li>
              <li>Swift / UI-Kit / SwiftUI</li>
              <li>React / JSX</li>
              <li>Node.js</li>
              <li>Express</li>
              <li>REST APIs</li>
              {/* Add more skills as needed */}
            </ul>
          </section>



        </Paper>
      </Container>

      <footer className="App-footer">
        <Typography variant="body2" className="App-footer-text">&copy; 2024 Your Name. All Rights Reserved.</Typography>
      </footer>
    </div>
  );
}

export default App;
